'use strict'

module.exports = class EnvInitializationError extends Error {
  constructor (message, status) {
    super(message)

    this.name = this.constructor.name
    Error.captureStackTrace(this, this.constructor)
    this.status = status || 500
  }
}

'use strict'

export default class NotImplementedError extends Error {
  constructor (message = 'This method is abstract and has not been overriden yet. Check the stack trace') {
    super(message)

    this.name = this.constructor.name
    Error.captureStackTrace(this, this.constructor)
    this.status = 500
  }
}

'use strict'

import BankAccount from './controllers/bankAccount'
import CreditCard from './controllers/creditCard'
import Token from './controllers/token'

export default class Intuit {
  constructor (args) {
    this.version = args.version
    this.production = args.production
  }

  BankAccount (accessToken, realmID) {
    return new BankAccount({
      version: this.version,
      production: this.production,
      accessToken: accessToken,
      realmID: realmID
    })
  }

  CreditCard (accessToken, realmID) {
    return new CreditCard({
      version: this.version,
      production: this.production,
      accessToken: accessToken,
      realmID: realmID
    })
  }

  Token (accessToken, realmID) {
    return new Token({
      version: this.version,
      production: this.production,
      accessToken: accessToken,
      realmID: realmID
    })
  }
}
